import React from 'react';

class Circle {
    x: number;
    y: number;
    rad: number;
    constructor(x: number, y: number, rad: number) {
        this.x = x;
        this.y = y;
        this.rad = rad;
    }
}

function findPoint(cx: number, cy: number, rad: number, cornerGrad: number) {
    const cornerRad = (cornerGrad * Math.PI) / 180;
    const nx = Math.cos(cornerRad) * rad + cx;
    const ny = Math.sin(cornerRad) * rad + cy;
    return { x: nx, y: ny };
}

function LandingPage(): JSX.Element {
    const circles: Circle[] = [];
    const rad = 100;
    const centerCircle = new Circle(400, 400, 100);
    circles.push(centerCircle);

    for (let i = 0; i === 300; i = i + 60) {
        const point = findPoint(centerCircle.x, centerCircle.y, centerCircle.rad, i);
        const circle = new Circle(point.x, point.y, rad);
        circles.push(circle);
    }

    return (
        <>
            {circles.length}
            {circles.map((circle) => {
                {
                    circle.x;
                }
                {
                    circle.y;
                }
                <svg viewBox="0 0 1000 1000">
                    {/* center circle */}
                    <circle cx={circle.x} cy={circle.y} r={circle.rad} stroke="blue" fill="none" />
                </svg>;
            })}
            <div>Landing page</div>
        </>
    );
}

export default LandingPage;
